4				f	Политика конфиденциальности	Политика в отношении обработки персональных данных	<h3>1. Общие положения</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Настоящая политика обработки персональных данных составлена в соответствии с требованиями Федерального закона от 27.07.2006. №152-ФЗ &laquo;О персональных данных&raquo; и определяет порядок обработки персональных данных и меры по обеспечению безопасности персональных данных ИП Самигуллин И.А (далее &ndash; Оператор).<br />\r\nОператор ставит своей важнейшей целью и условием осуществления своей деятельности соблюдение прав и свобод человека и гражданина при обработке его персональных данных, в том числе защиты прав на неприкосновенность частной жизни, личную и семейную тайну.<br />\r\nНастоящая политика Оператора в отношении обработки персональных данных (далее &ndash; Политика) применяется ко всей информации, которую Оператор может получить о посетителях веб-сайта http://www.mandarin.one.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>2. Основные понятия, используемые в Политике</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Автоматизированная обработка персональных данных &ndash; обработка персональных данных с помощью средств вычислительной техники;<br />\r\nБлокирование персональных данных &ndash; временное прекращение обработки персональных данных (за исключением случаев, если обработка необходима для уточнения персональных данных);<br />\r\nВеб-сайт &ndash; совокупность графических и информационных материалов, а также программ для ЭВМ и баз данных, обеспечивающих их доступность в сети интернет по сетевому адресу http://www.mandarin.one;<br />\r\nИнформационная система персональных данных &mdash; совокупность содержащихся в базах данных персональных данных, и обеспечивающих их обработку информационных технологий и технических средств;<br />\r\nОбезличивание персональных данных &mdash; действия, в результате которых невозможно определить без использования дополнительной информации принадлежность персональных данных конкретному Пользователю или иному субъекту персональных данных;<br />\r\nОбработка персональных данных &ndash; любое действие (операция) или совокупность действий (операций), совершаемых с использованием средств автоматизации или без использования таких средств с персональными данными, включая сбор, запись, систематизацию, накопление, хранение, уточнение (обновление, изменение), извлечение, использование, передачу (распространение, предоставление, доступ), обезличивание, блокирование, удаление, уничтожение персональных данных;<br />\r\nОператор &ndash; государственный орган, муниципальный орган, юридическое или физическое лицо, самостоятельно или совместно с другими лицами организующие и (или) осуществляющие обработку персональных данных, а также определяющие цели обработки персональных данных, состав персональных данных, подлежащих обработке, действия (операции), совершаемые с персональными данными;<br />\r\nПерсональные данные &ndash; любая информация, относящаяся прямо или косвенно к определенному или определяемому Пользователю веб-сайта http://www.mandarin.one;<br />\r\nПользователь &ndash; любой посетитель веб-сайта http://www.mandarin.one; Предоставление персональных данных &ndash; действия, направленные на раскрытие персональных данных определенному лицу или определенному кругу лиц;<br />\r\nРаспространение персональных данных &ndash; любые действия, направленные на раскрытие персональных данных неопределенному кругу лиц (передача персональных данных) или на ознакомление с персональными данными неограниченного круга лиц, в том числе обнародование персональных данных в средствах массовой информации, размещение в информационно-телекоммуникационных сетях или предоставление доступа к персональным данным каким-либо иным способом;<br />\r\nТрансграничная передача персональных данных &ndash; передача персональных данных на территорию иностранного государства органу власти иностранного государства, иностранному физическому или иностранному юридическому лицу;<br />\r\nУничтожение персональных данных &ndash; любые действия, в результате которых персональные данные уничтожаются безвозвратно с невозможностью дальнейшего восстановления содержания персональных данных в информационной системе персональных данных и (или) результате которых уничтожаются материальные носители персональных данных.</p>\r\n\r\n<h3>3. Оператор может обрабатывать следующие персональные данные Пользователя</h3>\r\n\r\n<p>Фамилия, имя, отчество;<br />\r\nЭлектронный адрес;<br />\r\nНомера телефонов;<br />\r\nТакже на сайте происходит сбор и обработка обезличенных данных о посетителях (в т.ч. файлов &laquo;cookie&raquo;) с помощью сервисов интернет-статистики (Яндекс Метрика и Гугл Аналитика и других). Вышеперечисленные данные далее по тексту Политики объединены общим понятием Персональные данные.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>4. Цели обработки персональных данных</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Цель обработки персональных данных Пользователя &mdash; информирование Пользователя посредством отправки электронных писем; предоставление доступа Пользователю к сервисам, информации и/или материалам, содержащимся на веб-сайте.<br />\r\nТакже Оператор имеет право направлять Пользователю уведомления о новых продуктах и услугах, специальных предложениях и различных событиях. Пользователь всегда может отказаться от получения информационных сообщений, направив Оператору письмо на адрес электронной почты info@mandarin.one с пометкой &laquo;Отказ от уведомлениях о новых продуктах и услугах и специальных предложениях&raquo;.<br />\r\nОбезличенные данные Пользователей, собираемые с помощью сервисов интернет-статистики, служат для сбора информации о действиях Пользователей на сайте, улучшения качества сайта и его содержания.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>5. Правовые основания обработки персональных данных</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Оператор обрабатывает персональные данные Пользователя только в случае их заполнения и/или отправки Пользователем самостоятельно через специальные формы, расположенные на сайте http://www.mandarin.one.<br />\r\nЗаполняя соответствующие формы и/или отправляя свои персональные данные Оператору, Пользователь выражает свое согласие с данной Политикой. Оператор обрабатывает обезличенные данные о Пользователе в случае, если это разрешено в настройках браузера Пользователя (включено сохранение файлов &laquo;cookie&raquo; и использование технологии JavaScript).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>6. Порядок сбора, хранения, передачи и других видов обработки персональных данных</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Безопасность персональных данных, которые обрабатываются Оператором, обеспечивается путем реализации правовых, организационных и технических мер, необходимых для выполнения в полном объеме требований действующего законодательства в области защиты персональных данных.<br />\r\nОператор обеспечивает сохранность персональных данных и принимает все возможные меры, исключающие доступ к персональным данным неуполномоченных лиц.<br />\r\nПерсональные данные Пользователя никогда, ни при каких условиях не будут переданы третьим лицам, за исключением случаев, связанных с исполнением действующего законодательства.<br />\r\nВ случае выявления неточностей в персональных данных, Пользователь может актуализировать их самостоятельно, путем направления Оператору уведомление на адрес электронной почты Оператора info@mandarin.one с пометкой &laquo;Актуализация персональных данных&raquo;.<br />\r\nСрок обработки персональных данных является неограниченным. Пользователь может в любой момент отозвать свое согласие на обработку персональных данных, направив Оператору уведомление посредством электронной почты на электронный адрес Оператора info@mandarin.one с пометкой &laquo;Отзыв согласия на обработку персональных данных&raquo;.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>7. Трансграничная передача персональных данных</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Оператор до начала осуществления трансграничной передачи персональных данных обязан убедиться в том, что иностранным государством, на территорию которого предполагается осуществлять передачу персональных данных, обеспечивается надежная защита прав субъектов персональных данных.<br />\r\nТрансграничная передача персональных данных на территории иностранных государств, не отвечающих вышеуказанным требованиям, может осуществляться только в случае наличия согласия в письменной форме субъекта персональных данных на трансграничную передачу его персональных данных и/или исполнения договора, стороной которого является субъект персональных данных.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3>8. Заключительные положения</h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Пользователь может получить любые разъяснения по интересующим вопросам, касающимся обработки его персональных данных, обратившись к Оператору с помощью электронной почты info@mandarin.one.<br />\r\nВ данном документе будут отражены любые изменения политики обработки персональных данных Оператором. Политика действует бессрочно до замены ее новой версией.<br />\r\nАктуальная версия Политики в свободном доступе расположена в сети Интернет по адресу http://www.mandarin.one/privacy/.</p>	2019-01-29 17:07:06.409031+03	/privacy/	1	2	3	0	\N	1
